import React, { Component } from 'react';

import Plus from './plus';
import Minus from './minus';


class Counter extends Component {
    constructor(){
        super();

        this.state = {
            counter: 0
        };
    }
    render() {
      return(
          <div>
              <Plus />
                <Minus />
                { this.state.counter }
          </div>



      );
    }
}
export default Counter;
